package io.quicktype;

public class Timezone {
    private String timezoneNew;
    private String old;

    public String getTimezoneNew() { return timezoneNew; }
    public void setTimezoneNew(String value) { this.timezoneNew = value; }

    public String getOld() { return old; }
    public void setOld(String value) { this.old = value; }
}
